import React,{useEffect} from "react";
import ImageCard from "../ImageCard/ImageCard";
import { useDispatch, useSelector } from "react-redux";
import {getAllImages, fetchAsyncImages} from "../../features/Images/imageSlice";
import { useParams } from "react-router-dom";
import './Tree.css';

const Tree = (props) => {
    const {data}=props;
    let params = useParams();
    console.log(params);
    const dispatch = useDispatch();

    useEffect(()=>{
        dispatch(fetchAsyncImages(data));
    });

    const images = useSelector(getAllImages);
    console.log(images);
    // let renderImages= "";
    const renderImages = images.hits.length ===0 ? <div> Loading </div> : (images.hits.map((image, index) => {
      return( 
        <ImageCard key={index} data={image} />
      );
      }));
    return (
        <div className="container">
            <div className="image-container">{renderImages}</div>
        </div>
    );
};

export default Tree;
